# Import necessary libraries
import pandas as pd
import numpy as np
import seaborn as sns
import matplotlib.pyplot as plt
from sklearn.preprocessing import StandardScaler
from sklearn.model_selection import StratifiedKFold, cross_val_score
from sklearn.linear_model import LogisticRegression
from sklearn.metrics import (classification_report, confusion_matrix, accuracy_score,
                             precision_score, recall_score, f1_score, roc_curve, auc)
from scipy import stats
import tensorflow as tf
from tensorflow import keras

"""# Load dataset"""

dataset = pd.read_csv('pulsar_stars.csv')

"""# Rename columns for clarity

"""

dataset.columns = ['Mean Profile', 'Standard Deviation Profile', 'Excess Kurtosis Profile', 'Skewness Profile',
                   'Mean DM-SNR', 'Standard Deviation DM-SNR', 'Excess Kurtosis DM-SNR', 'Skewness DM-SNR', 'Target Class']

"""# Check for missing values

"""

print(dataset.isnull().sum())

"""# Visualize the distribution of each feature

# Count plot for the target variable
"""

plt.figure(figsize=(5,3))
sns.countplot(data=dataset, x='Target Class')
plt.title('Count of Target Classes')
plt.show()

"""# Prepare the data and target variable

"""

X = dataset.drop(['Target Class'], axis=1)
y = dataset['Target Class']

# Standardize the features
scaler = StandardScaler()
X = scaler.fit_transform(X)

"""# 1. K-Fold Cross-Validation for Logistic Regression and Neural Network

"""

kfold = StratifiedKFold(n_splits=10, shuffle=True, random_state=42)

"""# Logistic Regression with K-Fold

"""

log_reg_model = LogisticRegression(solver='liblinear')
log_reg_cv_results = cross_val_score(log_reg_model, X, y, cv=kfold)
print("Logistic Regression K-Fold Accuracy: %.4f%% (%.4f%%)" % (log_reg_cv_results.mean() * 100, log_reg_cv_results.std() * 100))

"""# Neural Network K-Fold Cross-Validation

"""

nn_accuracies = []

for train_index, val_index in kfold.split(X, y):
    X_train_fold, X_val_fold = X[train_index], X[val_index]
    y_train_fold, y_val_fold = y[train_index], y[val_index]

    # Define and compile the Neural Network model
    nn_model = keras.Sequential([
        keras.layers.Dense(64, activation='relu', input_shape=(X_train_fold.shape[1],)),
        keras.layers.Dense(32, activation='relu'),
        keras.layers.Dense(1, activation='sigmoid')
    ])

    nn_model.compile(optimizer='adam', loss='binary_crossentropy', metrics=['accuracy'])

"""# Train the Neural Network model

"""

nn_model.fit(X_train_fold, y_train_fold, epochs=10, batch_size=32, verbose=0)

# Evaluate on validation fold
_, accuracy = nn_model.evaluate(X_val_fold, y_val_fold, verbose=0)
nn_accuracies.append(accuracy)

print("Neural Network K-Fold Accuracy: %.4f%% (%.4f%%)" % (np.mean(nn_accuracies) * 100, np.std(nn_accuracies) * 100))

"""# Spliting the data

"""

X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.25, stratify=y, random_state=42)

"""# Train Logistic Regression

"""

log_reg_model.fit(X_train, y_train)
predictions_log_reg = log_reg_model.predict(X_test)

"""# Confusion Matrix for Logistic Regression

"""

conf_matrix_log_reg = confusion_matrix(y_test, predictions_log_reg)
plt.figure(figsize=(5,3))
sns.heatmap(conf_matrix_log_reg, annot=True, fmt='d', cmap='Blues')
plt.xlabel('Predicted labels')
plt.ylabel('True labels')
plt.title('Confusion Matrix for Logistic Regression')
plt.show()

"""# Train Neural Network

"""

nn_model = keras.Sequential([
    keras.layers.Dense(64, activation='relu', input_shape=(X_train.shape[1],)),
    keras.layers.Dense(32, activation='relu'),
    keras.layers.Dense(1, activation='sigmoid')
])
nn_model.compile(optimizer='adam', loss='binary_crossentropy', metrics=['accuracy'])
nn_model.fit(X_train, y_train, epochs=10, batch_size=32, validation_data=(X_test, y_test))

predictions_nn = (nn_model.predict(X_test) > 0.5).astype(int).flatten()
conf_matrix_nn = confusion_matrix(y_test, predictions_nn)

"""#Confusion Matrix for Neural Network"""

plt.figure(figsize=(5,3))
sns.heatmap(conf_matrix_nn, annot=True, fmt='d', cmap='Greens')
plt.xlabel('Predicted labels')
plt.ylabel('True labels')
plt.title('Confusion Matrix for Neural Network')
plt.show()

"""#Logistic Rgression"""

# 3. Metrics: Accuracy, Precision, Recall, F-score
print(f"Logistic Regression - Accuracy:{accuracy_score(y_test, predictions_log_reg)*100:.2f}%")
print("Precision:", precision_score(y_test, predictions_log_reg))
print("Recall:", recall_score(y_test, predictions_log_reg))
print("F-Score:", f1_score(y_test, predictions_log_reg))

"""#Neural Network"""

print(f"Neural Network - Accuracy:{accuracy_score(y_test, predictions_nn)*100:.2f}%")
print("Precision:", precision_score(y_test, predictions_nn))
print("Recall:", recall_score(y_test, predictions_nn))
print("F-Score:", f1_score(y_test, predictions_nn))

"""# 4. Overfitting and Underfitting Analysis

"""

log_reg_train_accuracy = accuracy_score(y_train, log_reg_model.predict(X_train))
log_reg_test_accuracy = accuracy_score(y_test, predictions_log_reg)
print(f"Logistic Regression Train Accuracy: {log_reg_train_accuracy}")
print(f"Logistic Regression Test Accuracy: {log_reg_test_accuracy}")

nn_train_accuracy = nn_model.evaluate(X_train, y_train, verbose=0)[1]
nn_test_accuracy = nn_model.evaluate(X_test, y_test, verbose=0)[1]
print(f"Neural Network Train Accuracy: {nn_train_accuracy}")
